window.bookSummaryJSON = "<p>After a shocking loss, Stone Barrington is at loose ends, unsure if he wants to stay in New York and continue his work as a partner at Woodman &amp; Weld. It comes as a welcome relief when he's summoned to Washington, D.C., by President Will Lee. The president has a special operation that calls for Stone's unique skill set, and it's a mission that will reunite him with his former partner in crime and in bed, Holly Barker.</p>"; 
